import React, { useState } from "react";
import { Button, Paper } from "@mui/material";

export default function AboutPageButton({ Text }) {
  const [active, setActive] = useState(false);

  return (
    <>
      <Button
        onClick={setActive(true)}
        disableRipple={1}
        style={{ background: "none" }}
      >
        {Text}
      </Button>
      {active === true ? (
          <Paper
            style={{
              width: "100px",
              height: "10px",
            }}
          />
        ) : null}
    </>
  );
}
